import React from "react";
import "./Login.css"; // Importing the CSS file

const ClearOutput = () => {
    const Email = document.getElementById('email-address');
    const Password = document.getElementById('password');

    if (!(Email === "") || !(Password === "")) {
        Email.value = "";
        Password.value = "";
    }
};

const LoginBtn = () => {};

const Login = () => {
    return (
        <div className="login-container">
            <div className="login-form-container">
                <h2 className="login-title">Student Sign In</h2>
                <form className="login-form">
                    <div className="form-group">
                        <input className="form-input pa2 input-reset ba bg-transparent hover-bg-black hover-white w-100" type="email" name="email-address" id="email-address" placeholder="Email" />
                    </div>
                    <div className="form-group">
                        <input className="form-input pa2 input-reset ba bg-transparent hover-bg-black hover-white w-100" type="password" name="password" id="password" placeholder="Password" />
                        <a href="#0" className="forgot-password">Forgot your password?</a>
                    </div>
                    <div className="form-actions">
                        <input className="login-btn f6 grow no-underline br-pill ba bw1 ph3 pv2 mb2 dib dark-blue" type="submit" value="Log In" onClick={LoginBtn} />
                        <input className="clear-btn f6 grow no-underline br-pill ba bw1 ph3 pv2 mb2 dib dark-blue" type="reset" value="Clear" onClick={ClearOutput} />
                    </div>
                </form>
            </div>
            <footer className="footer">
                <small className="copyright">Â© Created by Group CC, All Rights Reserved.</small>
            </footer>
        </div>
    );
}

export default Login;
